function getDataCfg() {
  const _columns = [];
  const data = [];
  const columns = [];
  const rows = ['index'];
  const values = ['value'];
  const meta = [{
    field: 'index',
    name: '编号',
  }];

  // 拼凑表头数据
  schema.forEach((ele, index) => {
    columns.push(ele.fieldName);
    const children = ele.children && ele.children.slice(1);
    if (children) {
      const temp = [ele.fieldName];
      children.forEach((item, i) => {
        const childKey = `${i}@index_${ele.fieldName}`;
        columns.push(childKey);
        const prev = children[i - 1];
        item.dataUniq.forEach((item, j) => {
          if (!temp.includes(childKey)) {
            temp.push(childKey);
          }
          if (prev && prev.dataUniq) {
            prev.dataUniq.forEach(ele => {
              _columns.push(temp);
            });
          } else if (children.length === 1) {
            _columns.push(temp);
          }
        });
      });
    } else {
      _columns.push([ele.fieldName]);
    }
  });

  // 设置表头label
  let tempLabel = {};
  const cols = _columns.reduce((arr, ele, i) => {
    const level = ele.length;
    const col = {};
    // 遍历度量层级
    ele.forEach((ele, j) => {
      if (ths[j][i]?.label) {
        tempLabel[j] = ths[j][i]?.label;
      }
      col[ele] = tempLabel[j];
    });
    arr.push(col);

    return arr;
  }, []);

  console.log('wukai---111111', cols);


  // tds.forEach((rows, i) => {
  //   cols.forEach((item, j) => {
  //     const value = {
  //       ...item,
  //       value: rows[j]?.label,
  //       index: i,
  //     };
  //     data.push(value);
  //   });
  // });
  const _tempLabel = {};
  cols.forEach((item, i) => {
    tds.forEach((rows, j) => {
      if(rows[i]?.label) {
        _tempLabel[i] = rows[i]?.label;
      }
      const value = {
        ...item,
        value: _tempLabel[i],
        index: j,
      };

      data.push(value);
    });
  });

  console.log('wukai---data', data);

  const flatArr = [];

  _columns.forEach((ele, i) => {
    ele.forEach(key => {
      if (!flatArr.includes(key)) {
        const name = cols[i][key];
        flatArr.push(key);
        meta.push({
          field: key,
          name,
        });

      }
    });
  });


  return {
    data,
    fields: {
      columns,
      rows,
      values,
    },
    meta,
  };
}


